import React from "react";
import Navbar from "../components/Navbar";

const Acceuil = () => {
  return (
    <div className="acceuil">
      <Navbar />
      <div className="img-acceuil">
        <img src="./img/dune.png" alt="" />
      </div>
    </div>
  );
};

export default Acceuil;
